  Form,
  Header,
  Grid,
  Button,
  Segment,
  Message,
} from "semantic-ui-react";

class ViewRequest extends Component {
  render() {
    return (
      <Layout>
        <h2>view Request</h2>
      </Layout>
    );
  }
}

export default ViewRequest;
